Get data from two collections in loop using mongoose<p>I want to make search api. From request body location search the user. For that I need data from two collections i.e. user collection and sessionSlot collection. From user collection want fullname, profilepic, location, mail, etc. and from user's _id want data from sessionSlot collection. </p>

<p>I tried following code:</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>var register = mongoose.model("user");
var sessionSlot = mongoose.model("sessionSlot");

register.find({
          'location.address': {
            $regex: '^' + req.body.address,
            $options: 'i'
          },
        }]
      }).exec(function (err, userDetail) {
        for (var i = 0; i &lt; userDetail.length; i++) {

          sessionSlot.findOne({
            'userID': userDetail[i]._id
          }).exec(function (err1, slotData) {
            if(slotData) {
              if(slotData.sessions.length &gt; 0) {
                async.eachSeries(slotData.sessions, (slots, callback) =&gt; {
                  if (req.body.date) {
                    if (moment(slots.date).isSame(moment(req.body.date), 'day')) {
                      // console.log('slots---&gt;', slots);                  
                      sessionData.push({
                        time: slots.time,
                        status: slots.status,
                        slotID: slotData.slotID,
                      });
                    }
                  }
                  else {
                    sessionData.push({
                      time: slots.time,
                      status: slots.status,
                      slotID: slotData.slotID,
                    });
                  }
                  slotCnt++;
                  callback();
                });
              }
            }
            else {
              console.log('no slot created..',slotData);
              sessionData = [];
            }
           })
        }
        res.json({'code':200, 'data':sessionData})
      })</code></pre>
</div>
</div>
</p>

<p>I am not getting proper response from the sessionSlot collection, sometimes it is overwritten data or sometimes null (like taking last value from array). </p>

<p>Please give me suggestion!!</p>

<p>I am using mongoose version 4.5 (Not using aggregate)</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>user schema: 
var UserSchema = mongoose.Schema({ 
   fullname:   { type: String, default: null },
   mail :   { type: String, default: null },
   profilepic :   { type: String, default: null },
})

sessionSlot schema:
var sessionSlotSchema = mongoose.Schema({

    userID      : { type: String },
    mail        : { type: String },
    slotID      : { type: String },
    slotFlag    : { type: Boolean },
    sessions    : [{
                    status       : { type: String, default:'empty' },
                    profilepic   : { type: String, default:null },
                    fullname     : { type: String, default:null },
                    autoBook     : { type: Boolean, default:false },
                    time         : { type: String, default: null }
    }]
})</code></pre>
</div>
</div>
</p>

