MongoDB: How to apply multiple $project on aggregation<p>Given below is a sample document from the <code>my_collection</code></p>

<pre><code>{
  "_id":ObjectId("5b3f4e1013aad111501b34c4")
  "Text":["kjsdf sdfjgnks vk ekl sdsdd."],
  "Title":["lkdjf wufk"],
  "List":["3412","1244","7654","8476"],
  "__v":0
}
</code></pre>

<p>I want to aggregate over <code>my_collection</code> such that:   </p>

<ol>
<li>A field "totalList" is generated which would contain the count of items in the array in the field "List".   </li>
<li>Prevent field "__v" from showing up in the result.  </li>
<li>Change the Value of the output field "List" to a join of the array  </li>
<li>Remove the trailing comma at the end of the string in "List"  </li>
<li>Cut short the string generated by the 4th point to contain only the first 50 characters in the field of "List" </li>
</ol>

<p>So I wrote this code:</p>

<pre><code>  db.my_collection.aggregate( 
      [ 
         {
           $addFields: {
             totalList: { $size: "$List" }  // I can achieve the 1st point with this
           }
         },
         { $project : { 
                          __v:0,  // I can achieve the 2nd point with this
                          List:
                          {
                            $reduce:  // I can achieve the 3rd point with this
                               {
                                 input: "$List",
                                 initialValue: "",
                                 in: { $concat : ["$$value", "$$this", ","] }
                               }
                          }
                       }
          }
      ] 
  );
</code></pre>

<p>However, I'm getting the following error when I run the above command:</p>

<pre><code>  Failed to execute a script.

  Error:
  Assert: command failed: {
    "ok" : 0,
    "errmsg" : "Bad projection specification, cannot include fields or add computed fields during an exclusion projection: { __v: 0.0, List: { $reduce: { input: \"$List\", initialValue: \"\", in: { $concat: [ \"$$value\", \"$$this\", \",\" ] } } } }",
    "code" : 40182,
    "codeName" : "Location40182"
  } : aggregate failed
  _getErrorWithCode@src/mongo/shell/utils.js:25:13
  doassert@src/mongo/shell/assert.js:16:14
  assert.commandWorked@src/mongo/shell/assert.js:370:5
  DBCollection.prototype.aggregate@src/mongo/shell/collection.js:1319:5
  DBCollection.prototype.aggregate@:1:355
  @(shell):1:1

  Error: command failed: {
    "ok" : 0,
    "errmsg" : "Bad projection specification, cannot include fields or add computed fields during an exclusion projection: { __v: 0.0, List: { $reduce: { input: \"$List\", initialValue: \"\", in: { $concat: [ \"$$value\", \"$$this\", \",\" ] } } } }",
    "code" : 40182,
    "codeName" : "Location40182"
  } : aggregate failed :
  _getErrorWithCode@src/mongo/shell/utils.js:25:13
  doassert@src/mongo/shell/assert.js:16:14
  assert.commandWorked@src/mongo/shell/assert.js:370:5
  DBCollection.prototype.aggregate@src/mongo/shell/collection.js:1319:5
  DBCollection.prototype.aggregate@:1:355
  @(shell):1:1
</code></pre>

<p>Hence, I rewrote it to: </p>

<pre><code>  db.my_collection.aggregate( 
      [ 
         {
           $addFields: {
             totalList: { $size: "$List" }  // Achieve the 1st point with this
           }
         },
         { $project : { 
                          "Text":1,
                          "Title":1,
                          __v:{     // Achieve the 2nd point with this
                              $cond: {
                                 if: { $eq: [1,1] },
                                 then: "$$REMOVE",
                                 else: 0
                              }
                          },
                          List:
                          {
                            $reduce:  // Achieve the 3rd point with this
                               {
                                 input: "$List",
                                 initialValue: "",
                                 in: { $concat : ["$$value", "$$this", ","] }
                               }
                          }
                       }
          }
      ] 
  );
</code></pre>

<p>Now, I could achieve the first 3 points.<br>
However, how can I achieve the 4th and 5th point?</p>

